INSERT INTO `g5_write_business` VALUES (510,'',-1,'',510,0,0,'','','','2021년도 21세기 신규장각 자료구축 사업 연구용역 지원 사업 공고','2021년도 21세기 신규장각 자료구축 사업 한국학 연구용역 사업 공고\r\n\r\n\r\n서울대학교 규장각한국학연구원에서는 한국학 연구의 새로운 도약을 위하여 2021년도 21세기 신규장각 자료구축사업의 연구 용역 과제를 아래와 같이 공모합니다.\r\n\r\n                                                                               서울대학교 규장각한국학연구원 한국학연구사업위원장 은기수\r\n\r\n□ 사업의 목적\r\n ◦ 규장각 자료를 이용한 연구를 지원하여 한국학의 토대 구축과 발전의 발판 마련\r\n  ⑴ 한국학 연구의 심화·발전을 뒷받침할 수 있는 토대로서 기초자료 구축 지원\r\n  ⑵ 한국학 연구의 양적 성장과 함께 질적 도약에 기여할 만한 연구 성과 지원\r\n  ⑶ 다양한 한국학 전공자의 참여를 통한 규장각 자료를 분석하는 시각과 방법론 확대\r\n\r\n□ 지원내용\r\n ◦ 지원 분야: 규장각 자료 활용을 위한 토대 구축과 방법론 개발 \r\n  ⑴ 규장각 소장 자료의 교감 및 정본화, 심화 해제, 역주 등의 토대 연구\r\n  ⑵ 규장각 자료를 이용한 이용한 연구 주제 확대와 새로운 자료 및 연구방법론 제시\r\n ◦ 지원 규모: 5과제 내외\r\n ◦ 구체적인 지원 내용은 첨부된 신청요강 참조\r\n  \r\n□ 일정 \r\n ◦ 공고기간: 공고일 ~ 2021년 3월 26일(금)\r\n ◦ 신청기간: 공고일 ~ 2021년 3월 26일(금) 17:00\r\n ◦ 선정결과 안내 : 2021년 4월 23일(금) 이후 (개별통보)\r\n\r\n□ 신청 방법, 제출서류, 참여자격 등은 첨부된 신청요강 참조\r\n□ 지원과제 선정 후 과제의 타기관 중복 지원 여부 확인을 위하여 본원 홈페이지를 통해 일정기간 고시 및 이의신청 접수 예정\r\n\r\n□ 문의처: 한국학연구사업지원실 02) 880-2647\r\n\r\n※ 붙임: 2021년도 21세기 신규장각 자료구축사업 한국학 연구용역 신청요강.','2021년도 21세기 신규장각 자료구축 사업 연구용역 지원 사업 공고','','',0,0,238,0,0,'admin','','최고관리자','admin@domain.com','','2021-03-12 13:38:47',1,'2021-03-12 13:38:47','147.46.103.125','','',1,'2021-03-12 00:00:00','2021-03-26 00:00:00',0,0,'2','0','0',''),(511,'',-2,'',511,0,0,'','','','2021년도 21세기 신규장각 자료구축 사업 한국학 저술 지원 사업 공고','2021년도 21세기 신규장각 자료구축 사업 \r\n한국학 저술 지원 공고\r\n\r\n\r\n서울대학교 규장각한국학연구원에서는 한국학 연구의 새로운 도약을 위하여 2021년도 ‘한국학 저술 지원’ 과제를 아래와 같이 공모합니다.\r\n\r\n서울대학교 규장각한국학연구원 한국학연구사업위원장 은기수\r\n\r\n\r\n□ 사업의 목적\r\n ◦ 한국학 연구의 양적 성장과 질적 도약에 기여할 만한 연구 저술 지원\r\n ◦ 전통 및 근현대 시기 한국을 주제로 한 다양한 분야의 연구 저술 활성화\r\n\r\n□ 지원내용\r\n ◦ 한국학 저술 지원\r\n     - 한국학 제 분야의 개인 및 공동 연구로서, 연구 결과물을 단행본으로 출간할 수 있는 과제\r\n ◦ 지원 규모: 13과제 내외\r\n ◦ 구체적인 지원 내용은 첨부된 신청요강 참조\r\n  \r\n□ 일정 \r\n ◦ 공고기간: 공고일 ~ 2021년 3월 26일(금)\r\n ◦ 신청기간: 공고일 ~ 2021년 3월 26일(금) 17:00\r\n ◦ 선정결과 안내 : 2021년 4월 23일(금) 이후(예정, 개별통보)\r\n\r\n□ 신청 방법, 제